import './App.css';

function App() {
  return (
    <div className="App">
      <h1>test</h1>
      <Parent />
    </div>
  );
}

function Parent() {
  return (
    <div className="parent">
      <h2>I'm your parent.</h2>
      <Child text={"Will this work?"}/>
    </div>
  );
}

function Child() {
  return (
    <div className="child"></div>
  );
}

export default App;
